integration_02:
node State {
    has name: str;
}

walker StateMachine {
    has current_state: str = "IDLE";

    can transition with State entry {
        if here.name == "START" {
            self.current_state = "RUNNING";
            visit [-->]?name == "PROCESS";
        } elif here.name == "PROCESS" {
            self.current_state = "DONE";
        }
    }
}

with entry {
    start = State(name="START");
    process = State(name="PROCESS");
    end = State(name="END");
    start ++> process ++> end;
    start spawn StateMachine();
}

