integration_05:
node DataNode {
    has id: int;
    has data: str;
}

walker CrudWalker {
    has operation: str;
    has node_id: int = 0;
    has node_data: str = "";

    can create with entry {
        if self.operation == "create" {
            new_node = DataNode(id=self.node_id, data=self.node_data);
            here ++> new_node;
            report f"Created node {self.node_id}";
        }
    }

    can read with DataNode entry {
        if self.operation == "read" and here.id == self.node_id {
            report f"Node {here.id}: {here.data}";
        }
    }

    can update with DataNode entry {
        if self.operation == "update" and here.id == self.node_id {
            here.data = self.node_data;
            report f"Updated node {self.node_id}";
        }
    }

    can delete with DataNode entry {
        if self.operation == "delete" and here.id == self.node_id {
            del here;
            report f"Deleted node {self.node_id}";
        }
    }
}
